import React, { Component } from 'react'

export default class CashFlow extends Component {
    render() {
         //Get the passed in prop
         const cash_flow = this.props.cash_flow; 
         let keys = [];
         
         //Push all keys onto an array
         Object.keys(cash_flow).forEach(key =>
             keys.push(key)     
         ); 
         
         //For each key create a display
         const display = keys.map(key => 
             <p key={key}>{key}: {cash_flow[key]}</p>
         );
 
         return (
             <div>
                 <h1>Company Cash_Flow</h1>
                 {display}
             </div>
         )
    }
}
